import React, { Component } from "react";
import "./Cards.css";

class Cards extends Component {
  render() {
    return (
      <div className="card">
        <div className="card-background">
          <img src="" className="card-image" />
        </div>

        <div className="card-info">
          <img src="" className="card-profile-image" />
          <h1 className="card-profile-title">Sehbaz Rafik</h1>
          <p className="card-profile-subtitle">web developer</p>
        </div>

        <div className="card-desc">
          <p>
            The challenge goal is to build a component which displays content
            using the Card design pattern, according to the specs included.
          </p>
        </div>
      </div>
    );
  }
}
export default Cards;
